import React, { useState } from 'react';
import './profiel-aanmaken.css';

const ProfielAanmaken = () => {
    const [formData, setFormData] = useState({
        nickname: '',
        oneliner: '',
        waarderingRelatie: '',
        watZoektPartner: '',
        gezichtsfoto: null,
        geslacht: '',
        interesseInGeslacht: '',
        geboortedatum: '',
    });

    const [optionalFields, setOptionalFields] = useState({
        Opleidingsniveau: false,
        TalenDieJeSpreekt: false,
        Beroep: false,
        Hobbies: false,
        Sportiviteit: false,
        Cultuur: false,
        MijnStijl: false,
        UitgaansFrequentie: false,
        Muziekstijlen: false,
        AlcoholFrequentie: false,
        Huisdieren: false,
        Kinderen: false,
        Kinderwens: false,
        Postcode: false,
        Relatie: false,
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleFileChange = (e) => {
        setFormData({ ...formData, gezichtsfoto: e.target.files[0] });
    };

    const handleCheckboxChange = (e) => {
        const { name, checked } = e.target;
        setOptionalFields({ ...optionalFields, [name]: checked });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        const selectedFields = Object.keys(optionalFields).filter(
            (key) => optionalFields[key]
        );
        if (selectedFields.length < 2) {
            alert('Kies minimaal 2 optionele velden.');
            return;
        }
        console.log('Formulierdata:', formData);
        console.log('Geselecteerde velden:', selectedFields);
        // Voeg hier logica toe om gegevens op te slaan of door te sturen.
    };

    return (
        <div className="profiel-container">
            <h2>Profiel Aanmaken</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>Nickname:</label>
                    <input
                        type="text"
                        name="nickname"
                        value={formData.nickname}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label>Oneliner:</label>
                    <input
                        type="text"
                        name="oneliner"
                        value={formData.oneliner}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label>Waardering Relatie:</label>
                    <input
                        type="text"
                        name="waarderingRelatie"
                        value={formData.waarderingRelatie}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label>Wat zoek je in een partner?</label>
                    <textarea
                        name="watZoektPartner"
                        value={formData.watZoektPartner}
                        onChange={handleInputChange}
                        required
                    ></textarea>
                </div>
                <div className="form-group">
                    <label>Gezichtsfoto:</label>
                    <input type="file" onChange={handleFileChange} required />
                </div>
                <div className="form-group">
                    <label>Geslacht:</label>
                    <select
                        name="geslacht"
                        value={formData.geslacht}
                        onChange={handleInputChange}
                        required
                    >
                        <option value="">Selecteer</option>
                        <option value="Man">Man</option>
                        <option value="Vrouw">Vrouw</option>
                        <option value="Anders">Anders</option>
                    </select>
                </div>
                <div className="form-group">
                    <label>Interesse in geslacht:</label>
                    <select
                        name="interesseInGeslacht"
                        value={formData.interesseInGeslacht}
                        onChange={handleInputChange}
                        required
                    >
                        <option value="">Selecteer</option>
                        <option value="Man">Man</option>
                        <option value="Vrouw">Vrouw</option>
                        <option value="Beide">Beide</option>
                    </select>
                </div>
                <div className="form-group">
                    <label>Geboortedatum:</label>
                    <input
                        type="date"
                        name="geboortedatum"
                        value={formData.geboortedatum}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="optional-section">
                    <h3>Kies minimaal 2 optionele velden:</h3>
                    <div className="form-group-container">
                        {Object.keys(optionalFields).map((field) => (
                            <div key={field} className="form-group">
                                <label>
                                    <input
                                        type="checkbox"
                                        name={field}
                                        checked={optionalFields[field]}
                                        onChange={handleCheckboxChange}
                                    />
                                    {field
                                        .replace(/([A-Z])/g, ' $1')
                                        .replace(/^./, (str) =>
                                            str.toUpperCase()
                                        )}
                                </label>
                            </div>
                        ))}
                    </div>
                </div>
                <button type="submit">Registreren</button>
            </form>
        </div>
    );
};

export default ProfielAanmaken;
